message: "Модель Submariner от представленная в 1953 году  стала первыми водонепроницаемыми часами , выдерживающими глубину до 100 метров . \r\n Модель имеет вращающийся безель ,  Triplock-заводную головку, обеспечивающие герметичность  даже в экстремальных условиях. \r\n Конструкция включает хромалитовый циферблат , черный керамический безель , подчеркивающие  спортивный стиль. \r\n<a href=\"https://rolex-submariner-shop.ru\">Наручные часы Rolex Submariner приобрести</a> \r\n Автоподзавод до  3 суток сочетается с автоматическим калибром , что делает их надежным спутником  для активного образа жизни. \r\n За десятилетия Submariner стал  символом часового искусства, оцениваемым как  эксперты."
